    false,nt"url": null,nt"notes": "NOAA Abandoned Vessel Project Data for
    Saipan. Abandoned vessels pose a significant threat to the NOAA Trust resources
    through physical destruction of coral habitats and dispersion of toxic chemicals
    and gear. The Damage Assessment Center (DAC) is addressing this issue by creating
    a comprehensive database of abandoned vessels. These vessels can potentially threaten
    coral ecosystems in U.S. waters. Current databases are limited in their scope or
    definition of abandoned vessels. The inventory is a compilation of existing data
    from sources such as NOAA, the U.S. Coast Guard, States, Territories and the maritime
    industry, as well as original data from maps and personal interviews with local
    sources.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
